import { Box, FormControl, FormHelperText, Input, InputLabel, Typography } from "@mui/material";



const AddCredential = (props:any)=>{

    return (
        <Box>
            <Typography>Create new credential</Typography>
        <FormControl>
            <InputLabel htmlFor="my-input">Credential title</InputLabel>
            <Input id="my-input" aria-describedby="my-helper-text"/>
            {/* <FormHelperText id="my-helper-text">We will never share your email</FormHelperText> */}
            <InputLabel htmlFor="credential-value">Credential value</InputLabel>
            <Input id="my-input" aria-describedby="my-helper-text"/>
        </FormControl>
        </Box>
    )

}

export default AddCredential;
